import React, { Component } from 'react';


 class KitapFoto extends Component {
    render() {
        return (
            <div className='KitapFoto'>
             
        <img src={require('../../3main/bookShelf/booksImgs/' + this.props.img)} />
      
            </div>
        )
    }
}
export default KitapFoto;
